import React from 'react';
import { StyledCell } from '../../styles/StyledCell';
import { TETROMINOS } from '../../../tetrominos';

const Cell = ({type, height}) => (
    <StyledCell type={type} color={TETROMINOS[type].color} height={height} />
);

export default Cell;
